import React from 'react';
import Header from './Header';
import Footer from "./Footer";
import Note from './Note';
import notes from "./notes";

function App() {
    return(
    <div>
      <Header />

        {notes.map(function createNoteItem(newItem) {
            return (<note
                    key = {newItem.key}
                    title ={newItem.title}
                    content ={newItem.content}
                />
            );
        })}



      <Footer />
    </div>
    );
}

export default App;
